import React from 'react';
import styled from 'styled-components';
import mq from '../MediaQuery';

const FooterContainer = styled.footer`
            text-align: center;

`;


const Footer = () => {
  return (
    <FooterContainer>
        <p>
            Powered by <a href="#">w3.css</a>
        </p>
    </FooterContainer>
  );
};

export default Footer;
